all_tickers = [tickers_A, tickers_B, tickers_C, tickers_D, tickers_E, tickers_F, tickers_G, tickers_H, tickers_I, tickers_J, tickers_K, tickers_L, tickers_M, tickers_N, tickers_O, tickers_P, tickers_Q, tickers_R, tickers_S, tickers_T, tickers_U, tickers_V, tickers_W, tickers_X, tickers_Y, tickers_Z]

