datos = []

#Recorremos las listas de tickers y luego aislamos cada ticker
for lista in all_tickers:
    for ticker in lista:
        #Creamos la ruta
        url = "https://finance.yahoo.com/quote/"+ticker+"/history?period1=1605657600&period2=1637107200&interval=1d&filter=history&frequency=1d&includeAdjustedClose=true"
        
        #Abrimos la pagina
        browser.get(url)
        time.sleep(0.5)

        #Verificamos que la web sea de precios
        if browser.current_url == url:
            try:
                WebDriverWait(browser, 300).until(expected_conditions.presence_of_element_located((By.XPATH, '//*[@id="Col1-1-HistoricalDataTable-Proxy"]/section/div[2]/table/tbody/tr[1]/td[1]')))

                #Scrolleamos hasta el final de la pagina
                for i in range(10):
                    browser.execute_script("window.scrollBy(0,document.body.scrollHeight)")
                    time.sleep(0.1)

                #Creamos una lista vacia con los precios de cierre de cada acción 
                close_prices = []

                #Creamos una lista vacia con los precios posteriores a cuando una acción supera el 30% de su precio anterior
                prices_more_30 = []

                #Tomamos los elementos
                lista = browser.find_elements(By.CSS_SELECTOR, '#Col1-1-HistoricalDataTable-Proxy tbody tr')
                for elemento in lista:
                    #Parseamos los datos
                    elemento = elemento.text
                    elemento = elemento.split()
                    #Discriminamos los dividendos y agregamos el elemento a la lista
                    if "Dividend" not in elemento and "Stock" not in elemento:
                        close_prices.append(elemento[6])
                    else: 
                        continue

                for i in range(1, len(close_prices)-1):
                    resultado = float(close_prices[i])/float(close_prices[i+1])
                    if resultado >= 1.3:
                        price_var = ((float(close_prices[i-1])/float(close_prices[i]))-1)*100
                        prices_more_30.append(str(price_var)+"%")

                #Probamos imprimir los datos
                if len(prices_more_30) > 0:
                    prices_more_30.insert(0, ticker)
                else:
                    continue

                #Hacemos que la lista tenga 30 elementos
                if len(prices_more_30) < 30:
                    while len(prices_more_30) < 30:
                        prices_more_30.append("")
                
                #Si se pasan 30 elementos, los eliminamos
                if len(prices_more_30) > 30:
                    while len(prices_more_30) > 30:
                        prices_more_30.pop(-1)
                
                #Agregamos los datos a la lista principal
                datos.append(prices_more_30)
            except:
                continue
        
        #Si no lo es, agregamos a la lista de datos la indicación de que ese ticker no corresponde a una acción
        else: 
            continue

